import React, { Component } from 'react';
import { render } from 'react-dom';
import { Circle } from 'react-konva';

class Circulo extends React.Component {

  render() {
    return (
      <Circle
        name = {this.props.circulo.name}
        x = {this.props.circulo.x}
        y = {this.props.circulo.y}
        radius = {this.props.circulo.radius}
        fill= {this.props.circulo.fill}
        draggable
      />
    );
  }
}

export default Circulo;
